import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div className="home">
      <h1>Welcome to the Programming Language Learning Games</h1>
      <div className="buttons">
        <Link to="/game1">
          <button>Order Code Lines</button>
        </Link>
        <Link to="/game2">
          <button>Complete Code by Dragging Blocks</button>
        </Link>
        <Link to="/game3">
          <button>Select the Correct Answer</button>
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
